import axios from "axios";
import React, { useState, useEffect } from "react";
import "./AdminOrder.css";
function AdminOrder() {
	const [OrderList, SetOrderList] = useState([]);

	useEffect(() => {
		axios.post("http://localhost:3001/api/GetOrders").then((response) => {
			SetOrderList(response.data);
			console.log(response.data);
		});
	}, []);
	return (
		<div>
			<table>
				<tbody>
					<tr>
						<th>Person 1</th>
						<th>Person 2</th>
						<th>Person 3</th>
					</tr>
					{OrderList.map((info, index) => {
						return (
							<tr className="AdminOrderItem" key={index}>
								<td> {info.id}</td>
								<td> {info.name}</td>
								<td> {info.price}</td>

								<td> {info.SelectedOptions}</td>

								<td> {info.customTextArray}</td>
							</tr>
						);
					})}
					<tr>
						<td>16</td>
						<td>14</td>
						<td>10</td>
					</tr>
				</tbody>
			</table>
			{OrderList.map((info, index) => {
				return (
					<div className="AdminOrderItem" key={index}>
						<div> {info.id}</div>
						<div> {info.name}</div>
						<div> {info.price}</div>

						<div> {info.SelectedOptions}</div>

						<div> {info.customTextArray}</div>
					</div>
				);
			})}
		</div>
	);
}

export default AdminOrder;
